import React from "react";
export class Task10 extends React.Component{
    constructor(){
        super()
        this.state={1:0}
    }
    lk(){
        this.setState({1:"Hello"})
    }
    render(){
        return(
            <div>
                <input value="text"/>
                <br></br>
                <button onClick={()=>this.lk()}>1</button>
                <button>2</button>
                <button>3</button>
                <button>4</button>
                <button>5</button>
                <button>6</button>
                <button>7</button>
                <button>8</button>
                <button>9</button>
                <br></br>
                <button>+</button>
                <button>-</button>
                <button>*</button>
                <button>/</button>
                <button>%</button>
            </div>
        )
    }
}
export default Task10;
